def quantile(self, q=0.5, axis=0, numeric_only=True, interpolation="linear"):
    self._check_percentile(q)

    # Ensure that numeric_only argument is used
    if numeric_only:
        data = self._get_numeric_data()
    else:
        data = self

    axis = self._get_axis_number(axis)
    is_transposed = axis == 1

    if is_transposed:
        data = data.T

    # Compute the quantile using the numpy quantile function
    result = np.nanquantile(data._values, q, axis=axis, interpolation=interpolation)

    if is_transposed:
        result = result.T

    # Create the output Series or DataFrame based on the type of 'q'
    if isinstance(q, (float, int)):
        result = pd.Series(result, index=data.columns)
    else:
        result = pd.DataFrame(result, index=q, columns=data.columns)

    return result
